module.exports = JSON.parse('[{"id":1,"title":"OpenChat","description":"OpenChat is a research library of open-source language models, fine-tuned with C-RLFT - a strategy inspired by offline reinforcement learning. Our models learn from mixed-quality data without preference labels, delivering exceptional performance extremely cost efficient fine tuning and outstripping Grok 0&1, chatgpt, and now beginning to perform on par with gpt-4 on important benchmarks, with an exclusive focus on small locally focused models. Follow the link below to read the paper, follow the developers, contribute to the project, or download the tools.","image":"https://raw.githubusercontent.com/imoneoi/openchat/master/assets/logo_new.png","link":"https://github.com/imoneoi/openchat"},{"id":2,"title":"Open-Orca","description":"Open Orca is another research library of open-sourced language models and datasets designed around synthetic data optimization and at scale generation to understand its impact on the performance. the datasets and models are broadly used across the industry as a means to improve instruction following, alignment, intelligence and allow for an augmented base model capable of strong SOTA capabilities across a wide range of subjects to fine tune over for down stream tasks","image":"https://huggingface.co/datasets/Open-Orca/OpenOrca/resolve/main/OpenOrcaLogo.png","link":"https://huggingface.co/datasets/Open-Orca/SlimOrca"},{"id":3,"title":"Axolotl","description":"Axolotl is a tool designed to streamline the fine-tuning of various AI models, offering support for growing list of architectures, training methods, and modalities. its become a well known trainer in the open source due to its highly accessable and stable interface, broad range of features, and extreme compute efficiency","image":"https://github.com/OpenAccess-AI-Collective/axolotl/raw/main/image/axolotl.png","link":"https://github.com/OpenAccess-AI-Collective/axolotl"},{"id":4,"title":"AGIXT","description":"a dynamic Artificial Intelligence Automation Platform engineered to orchestrate efficient AI instruction management and task execution across a multitude of providers. Our solution infuses adaptive memory handling with a broad spectrum of commands to enhance AI\'s understanding and responsiveness, leading to improved task completion. The platform\'s smart features, like Smart Instruct and Smart Chat, seamlessly integrate web search, planning strategies, and conversation continuity, transforming the interaction between users and AI. By leveraging a powerful plugin system that includes web browsing and command execution, AGiXT stands as a versatile bridge between AI models and users. With an expanding roster of AI providers, code evaluation capabilities, comprehensive chain management, and platform interoperability.","image":"https://camo.githubusercontent.com/a722c36484d1b9e117dc31cbf450e1bc5148fd2ca930a10598faa9818fa74402/68747470733a2f2f6a6f73682d78742e6769746875622e696f2f41476958542f696d616765732f41476958542d6772616469656e742d666c61742e737667","link":"https://github.com/Josh-XT/AGiXT"},{"id":5,"title":"The Aphrodite Engine","description":"A high performance serving engine which provides cutting edge efficiency optimizations, compatibility with most quantization formats, several API schemas with advanced utilities, and one click serving for every model on huggingface.","image":"https://raw.githubusercontent.com/PygmalionAI/aphrodite-engine/main/assets/aphrodite.png","link":"https://github.com/PygmalionAI/aphrodite-engine"},{"id":6,"title":"xDAN","description":"Introducing the xDAN models a groundbreaking achievement in AI. These models, a fusion of advanced techniques and rich datasets, including @IntelAI\'s Orca dpo pairs (https://huggingface.co/datasets/Intel/orca_dpo_pairs) and a SFT on the Open Orca dataset (https://huggingface.co/datasets/Open-Orca/OpenOrca), demonstrate unparalleled performance. Excelling in mt-bench rankings, xDAN is second only to GPT-4 and boasts impressive scores in the lm eval harness. A milestone in AI, this release paves the way for future benchmarks and collaborative progress in AI technology.","image":"https://cdn-uploads.huggingface.co/production/uploads/643197ac288c9775673a01e9/tVAcwKkIH5vkfzqgqHeHi.png","link":"https://huggingface.co/xDAN-AI/xDAN-L1-Chat-RL-v1"},{"id":7,"title":"Benchmarking the benchmarks","description":"Join the forefront of AI benchmarking with our latest project. This initiative is focused on developing a new paradigm for evaluating AI models, addressing familiar challenges in the field. Our goal is to streamline and standardize benchmarking processes, ensuring peak performance from AI models with minimal prompt engineering by the user. This project is a call to action for collaboration and innovation in the AI community. Be part of this exciting journey to redefine AI benchmarking standards and practices.","image":"/images/benchmark.png","link":"https://discord.gg/KNXvq7tWvt"},{"id":8,"title":"Open Empathic","description":"A large scale data synthesis project in collaboration with LAION, to produce a model capable of intuitively understanding and responding to cross-modal emotional signals from the user, ranging from microexpressions, to nonverbal vocalizations","image":"/images/openempat.png","link":"https://dct.openempathic.ai/"},{"id":9,"title":"Project Alexandria","description":"A large scale data collection and curation project to build out a robust pipeline for extracting unstructured factual information from scientific documentation, books, articles and any other source of validated deterministic knowledge to populate a knowledge graph with a unique blueprint that allows for infinite scalability, a framework for tracking assumptions, inaccuracies, and domain knowledge limitations in AI while providing a large scale accessable database for accessability so that important research can be done without the barriers of cost and access to limit our understanding of the world, and of AI.","image":"/images/alexandria.png","link":"soonW"},{"id":10,"title":"The Lab","description":"A system of open sourced tools and frameworks that each serve as an open, scalable infrastructure for continuous public and private advancement, designed to perform autonomous alignment research and to provide routes for monitzation, innovation, and research, enabling developers to sustain themselves by following their passion, researchers to gain access to powerful tools and data, and users to enjoy the benefits of AI without the complexity of needing to code. it serves as a unified system to provide the experience that we believe will be the standard in the future and ensure access to it is unrestricted, private, and free.","image":"https://beeimg.com/images/p62598321701.png","link":"https://AlignmentLab.ai"},{"id":11,"title":"Jsonifize","description":"An in development research effort to continue a pretraining on a small but intelligent base model on formatted json objects such that the model generalizes to the schemas, and not only internally produces only properly formatted structured data, but can then be used for function calling, classification, labeling, as a reward model, with an ultimate goal of solving prompt engineering such that the user is always interacting with a model that performs at the peak of its capability in each response without having to worry about prompt formatting, further effort to additionally streamline, standardize, and simplify sampling and prompt formatting issues in general so that the end user can be able to use their local models without worrying about it, and recieve the best experience in exchange.","image":"https://huggingface.co/spaces/jsonifize/README/resolve/main/DALL%C2%B7E%202023-12-16%2003.01.26%20-%20A%20symbolic%20and%20iconic%20representation%20of%20structured%20data.%20Visualize%20a%20large%2C%20intricate%20structure%20resembling%20a%20database%2C%20with%20distinct%20layers%20and%20compar.png","link":"https://huggingface.co/jsonifize"},{"id":12,"title":"PLLM","description":"An early project designed to solve the issue of coding with large language models to generate not only accessability to programming for those who dont have the time or resources to learn, but to increase the sparse access to tutorials and data regarding less known or popular languages as well.","image":"https://aeiljuispo.cloudimg.io/v7/https://cdn-uploads.huggingface.co/production/uploads/6436279eaaef013d1af225c9/Sv-RtSu-WeI5WJuL2sFTq.png?w=200&h=200&f=face","link":"https://huggingface.co/Programming-Language"}]');

